import React from 'react';
import {
  Box,
  Button,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Paper,
  Typography,
} from '@mui/material';
import {
  servicesBoxStyles,
  serviceSectionBoxStyles,
  servicesSectionHeaderStyles,
  servicesSectionListBox,
  servicesSectionPaperStyles,
  servicesSectionTextStyles,
} from './servicesStyles.js';
import FiberManualRecordIcon from '@mui/icons-material/FiberManualRecord';
import CloudDownloadIcon from '@mui/icons-material/CloudDownload';
import ApartmentIcon from '@mui/icons-material/Apartment';
import AddLocationAltIcon from '@mui/icons-material/AddLocationAlt';
import {
  digitalModelTextData,
  listItemsData,
} from '../../constants/constants.js';

function Services(props) {
  return (
    <Box sx={servicesBoxStyles}>
      <Box sx={serviceSectionBoxStyles}>
        <Typography variant={'h3'} sx={servicesSectionHeaderStyles}>
          Цифровые карты
        </Typography>
        <Typography variant={'body1'} sx={servicesSectionTextStyles}>
          Цифровая топографическая карта – замечательное средство представления
          видимой информации о состояния местности, это набор метрических,
          семантических и логических данных об участке земной поверхности,
          хранящийся в файле определенного формата, доступном для компьютера.
        </Typography>
        <Typography variant={'body1'} sx={servicesSectionTextStyles}>
          Существующие технические и программные средства позволяют
          просматривать и манипулировать с данными на экране дисплея, выполнять
          расчеты для решения различных задач. Компактность хранения информации,
          оперативность ее обновления эти качества обеспечивают широкий набор
          возможностей применения цифровой карты. Компания &#34;Интэкарт&#34;
          предлагает свои услуги для создания и обновления:
        </Typography>
        <List sx={servicesSectionListBox}>
          {listItemsData.map((data, index) => (
            <ListItem
              // variant={'outlined'}
              key={index}
              // sx={servicesSectionSectionStyles}
            >
              <ListItemIcon>
                <FiberManualRecordIcon color={'primary'} />
              </ListItemIcon>
              <ListItemText primary={data} />
            </ListItem>
          ))}
        </List>
      </Box>
      {/*<Box sx={serviceSectionBoxStyles('reverse')}>*/}
      {/*<Typography variant={'h3'} sx={servicesSectionHeaderStyles}>*/}
      {/*  Адресные планы городов*/}
      {/*</Typography>*/}
      {/*<Typography variant={'body1'} sx={servicesSectionTextStyles}>*/}
      {/*  Цифровые технологии плотно вошли в нашу повседневную жизнь, и*/}
      {/*  большинство привычных нам вещей обрели своих аналогов в цифровом*/}
      {/*  варианте. В их числе и адресные планы населенных пунктов. Адресный*/}
      {/*  план города предназначен для достоверного отображения уличной сети и*/}
      {/*  строений, которым присвоен адрес, и может быть использован как*/}
      {/*  официальный источник информации о местоположении и наименовании*/}
      {/*  объектов городской среды.*/}
      {/*</Typography>*/}
      {/*<Typography variant={'body1'} sx={servicesSectionTextStyles}>*/}
      {/*  Цифровой вариант адресного плана - это всегда современная и точная*/}
      {/*  информация, с возможностью быстрого обновления до актуального*/}
      {/*  состояния. Компания &#34;Интэкарт&#34; предлагает свои услуги для*/}
      {/*  создания и обновления адресных планов интересующих вас населенных*/}
      {/*  пунктов. Если вы заинтересованы в наших услугах, можете связаться с*/}
      {/*  нами или оформить заявку. Также, вы можете ознакомиться со списком*/}
      {/*  населенных пунктов, адресные планы которых имеются у нас в архиве,*/}
      {/*  нажав на кнопку.*/}
      {/*</Typography>*/}
      {/*<Button*/}
      {/*  variant={'contained'}*/}
      {/*  color={'inherit'}*/}
      {/*  endIcon={<CloudDownloadIcon />}*/}
      {/*  href={'https://disk.yandex.ru/i/AqQZ--RR--bwpA'}*/}
      {/*  download*/}
      {/*  sx={{ mt: '30px' }}*/}
      {/*>*/}
      {/*  Планы городов (XLS)*/}
      {/*</Button>*/}
      {/*</Box>*/}
      <Box sx={serviceSectionBoxStyles}>
        <Typography variant={'h3'} sx={servicesSectionHeaderStyles}>
          Цифровые модели местности
        </Typography>
        <List sx={servicesSectionListBox}>
          {digitalModelTextData.map((data, index) => (
            <ListItem key={index}>
              <ListItemIcon>
                <FiberManualRecordIcon color={'primary'} />
              </ListItemIcon>
              <ListItemText primary={data} />
            </ListItem>
          ))}
        </List>
      </Box>
      <Box sx={serviceSectionBoxStyles()}>
        <Typography variant={'h3'} sx={servicesSectionHeaderStyles}>
          Подготовка цифровых карт к изданию{' '}
        </Typography>
        <Box sx={servicesSectionPaperStyles}>
          <Paper
            variant={'outlined'}
            square
            sx={servicesSectionPaperStyles()}
          >
            <ApartmentIcon fontSize={'large'} sx={{ mb: '20px' }} />
            <Typography variant={'body1'}>
              {
                'Создание и обновление адресных планов городов для навигационных карт'
              }
            </Typography>
          </Paper>
          <Paper
            variant={'outlined'}
            square
            sx={servicesSectionPaperStyles('reverse')}
          >
            <AddLocationAltIcon fontSize={'large'} sx={{ mb: '20px' }} />
            <Typography variant={'body1'}>
              {
                'Создание и обновление адресных планов городов для различных поисковых географических систем и геопорталов'
              }
            </Typography>
          </Paper>
        </Box>
      </Box>
    </Box>
  );
}

